import React from "react";

const Trending = () => {
  return (
    <div class="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 lg:grid-cols-5 xl:grid-cols-6 gap-6">
      <div className="trending-container">
        <div className="trending-card">
          <div className="trending-img"><img src="/assets/images/hxh.webp" alt="" /></div>
          <div className="trending-info">this is info</div>
        </div>
      </div>
    </div>
  );
};

export default Trending;
